translated_text:
Her zaman bunlardan birini istedim ve fiyat için çok fazla.  Sahip olduğum diğer ikisi Schlage ve Porter kablosuydu, bu yüzden güzel bir kaliteli ürün.  Çok fonksiyonlu bir düğmesi yoktur, ancak voltajı değiştirmek ve akımı değiştirmek için hızlı ve kolay bir yol sağlar.  Sağlam bir birim, ama kimseye tavsiye etmem.  Ona 5 yıldız vermemin tek nedeni, kurulumu biraz acı çekmesidir.  Bu satın alma işleminden çok memnunum.

Artıları:
-iyi kalite;
-Düşük maliyet;
-Harika;

Eksileri:
-Çok işlevli bir düğmesi yoktur;
-Wish listesi;

Bu iyi bir ürün, ama 5 yıldız vermeliyim çünkü çok işlevli bir düğmeye sahip olma fikrini sevmiyorum.  Bunun yerine tek bir fonksiyon düğmesine sahip olmayı tercih ederim.  Bunun neden böyle olduğundan emin değilim, ancak çok işlevli bir düğmesi olmamasını sevmiyorum.

GÜNCELLEME: Kendi elektroniklerim üzerinde çalışıyorum ve bu birim sonunda geldi.  Çok fazla kablolama var ve bağlanmak ve programlamak çok kolay.  Programlamak ve programlamak gerçekten kolaydır ve programlanması da çok kolaydır.  Bu üniteden çok memnunum.  Kalite iyi ve fiyat iyi.  Başka bir tane alıp alamayacağımdan emin değilim. Bu ürünü gerçekten seviyorum. Neredeyse bir yıldır kullanıyorum ve kullanmak biraz ağır. Tutmam gerekmiyor
